#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
#include <ctype.h>
#define new(type) (type*)malloc(sizeof(type))
typedef long long ll;

typedef struct stack{
    char token[4000];
    ll num[4000];
    int len;
} stack;

stack* initialize(){
    stack *stk = new(stack);
    stk->len = 0;
    return stk;
}

ll operate(ll a, ll b, char c){
    if (c=='+') return a+b;
    if (c=='-') return a-b;
    if (c=='*') return a*b;
    if (c=='/') return a/b;
    if (c=='%') return a%b;
}

void push(stack *stk, char c, ll n){
    if (c=='\0'){
        stk->num[stk->len++] = n;
        return;
    }
    else{
        stk->token[stk->len++] = c;
        return;
    }
}

ll num_pop(stack *stk){
    return stk->num[--(stk->len)];
}

void token_pop(stack *tstk, stack *nstk){
    char c = tstk->token[--(tstk->len)];
    if (c=='(') return;
    printf("%c", c);
    ll b = num_pop(nstk);
    ll a = num_pop(nstk);
    // printf("%lld %c %lld, get: %lld\n", a, c, b, operate(a, b, c));
    push(nstk, '\0', operate(a, b, c));
}

char peep(stack *stk){
    return stk->token[(stk->len)-1];
}

int log_10(ll num){
    int n = 0;
    while (num>0){
        n++;
        num/=10;
    }
    return n;
}

bool larger(char a, char b){
    if (a=='(') return false;
    if (a=='*'||a=='/'||a=='%') return true;
    if (b=='*'||b=='/'||b=='%') return false;
    return true;
}

int main(){
    int T=3;
    while (T--){
        char exp[4001]={'\0'}; scanf("%s", exp);
        ll len = strlen(exp), i=0;
        stack *tstk=initialize(), *nstk=initialize();
        while (i<len){
            // printf("Tokens: %d, Numbers: %d\n", tstk->len, nstk->len);
            // if (nstk->len==1) printf("%lld\n", nstk->num[0]);
            char c = exp[i];
            if (isdigit(c)){ //done
                ll num;
                sscanf(exp+i, "%lld", &num);
                if (num==0) i++;
                else i+=log_10(num);
                printf("%lld", num);
                push(nstk, '\0', num);
            }
            else{
                if (c=='(') push(tstk, c, 0);
                else if (c==')'){
                    while (tstk->len>0 && peep(tstk)!='(') token_pop(tstk, nstk);
                    token_pop(tstk, nstk);
                }
                else{
                    while (tstk->len>0 && larger(peep(tstk), c)) token_pop(tstk, nstk);
                    push(tstk, c, 0);
                }
                i++;
            }
        }
        while (tstk->len>0) token_pop(tstk, nstk);
        printf("=%lld\n", nstk->num[0]);
    }
}

class Weapon
{
    private readonly int _damage;
    private int _bullets;

    public Weapon(int damage, int bullets)
    {
        if (damage < 0)
            throw new ArgumentOutOfRangeException();

        if (bullets < 0)
            throw new ArgumentOutOfRangeException();

        _damage = damage ;
        _bullets = bullets;
    }

    public bool CanFire => _bullets > 0;

    public void Fire(IDamagable target)
    {
        if (target == null)
            throw new ArgumentNullException("target");

        if (CanFire)
        {
            target.TakeDamage(_damage);
            _bullets--;
        }
    }
}

class Player : IDamagable
{
    private int _health;

    public Player(int health)
    {
        if (health < 0)
            throw new ArgumentOutOfRangeException();

        _health = health;
    }

    public bool IsAlive => _health > 0;

    public void TakeDamage(int damage)
    {
        if (damage < 0)
            throw new ArgumentOutOfRangeException();

        if (IsAlive)
            _health = Math.Max(_health - damage, 0);
    }
}

class Bot
{
    private readonly Weapon _weapon;

    public Bot(Weapon weapon) => _weapon = weapon ?? throw new ArgumentNullException();

    public void OnSee(Player player)
    {
        if (player == null)
            throw new ArgumentNullException();

        if (player.IsAlive && _weapon.CanFire)
            _weapon.Fire(player);
    }
}

