async function addItem(conversation, ctx) {
    await ctx.reply('*Item creation*\n\n_Please send me the name of the item._', {
        parse_mode: 'Markdown'
    });
    const name = await conversation.form.text()
    await ctx.reply('Now, please send me the description of the item.');
    const description = await conversation.form.text()
    await ctx.reply('Now, please send me the price of the item.');
    const price = await conversation.form.number()
    await ctx.reply('Now, please send me the image of the item.');
    const image = await conversation.waitFor([':photo', ':document'])

    const radius = 100

    const imageInfo = await image.getFile()
    const imagePath = await imageInfo.download(`cdn/items/${imageInfo.file_id}.png`)

    await conversation.external(async () => {
        const imageSharp = sharp(imagePath);
        const metaData = await imageSharp.metadata();
        if (metaData.height !== 1080 || metaData.width !== 1080) {
            imageSharp.resize({
                width: 1080,
                height: 1080,
                fit: 'cover',
                position: 'center'
            });
        }
        await imageSharp.toBuffer()
            .then(data => {
                return sharp(data)
                    .composite([{ input: Buffer.from(`<svg><rect x="0" y="0" width="1080" height="1080" rx="${radius}" ry="${radius}" fill="white"/></svg>`), blend: 'dest-in' }])
                    .png()
                    .toFile(imagePath);
            });
    })

    await ctx.replyWithPhoto(new InputFile(imagePath), {
        caption: `*Confirmation*\n\nName: ${name}\nDescription: ${description}\nPrice: ${price}\nImage: Above photo\n_Please note that the photo will be edited to be a square if it isn't already a square_\n\nIs this correct?`,
        parse_mode: 'Markdown',
        reply_markup: new InlineKeyboard()
            .text('‚úÖ Confirm', 'confirm')
            .text('‚ùå Cancel', 'cancel')
    })

    const response = await conversation.waitForCallbackQuery(['confirm', 'cancel'], {
        otherwise: (ctx) => ctx.reply('Please use the buttons to confirm or cancel.', {
            reply_markup: new InlineKeyboard()
                .text('‚úÖ Confirm', 'confirm')
                .text('‚ùå Cancel', 'cancel')
        })
    })

    await response.deleteMessage()
    if (response.callbackQuery.data === 'cancel') {
        fs.rmSync(imagePath)
        await ctx.reply('Item creation cancelled.')
        return
    }

    await ctx.reply('*Loading..*\n_Please wait while I add the item to the database._', {
        parse_mode: 'Markdown'
    })

    await conversation.external(() => db.saveItems(name, description, price, imagePath))

    await ctx.reply('Item added successfully!');
}
